import React from "react";
import ReactStars from "react-rating-stars-component";
import "./SkillCard.css";
import EmptyStarIcon from "../../assets/icons/star_outline.svg";
import FullStarIcon from "../../assets/icons/star_filled.svg";

function SkillCard({ skillName, rating }) {
  return (
    <div className="skill-card">
        <h6>{skillName}</h6>
      <ReactStars
        count={5}
        onChange={() => {}}
        value={rating}
        size={36}
        edit={false}
        emptyIcon={<img src={EmptyStarIcon} alt="" />}
        fullIcon={<img src={FullStarIcon} alt="" />}
        activeColor="#D83A52"
      />
    </div>
  );
}

export default SkillCard;
